// Base64 encoded song
const base64Song = "";

// Create an audio element
const audioElement = document.createElement('audio');
audioElement.src = 'data:audio/mp3;base64,' + base64Song;

// Function to play the song
function playSong() {
  audioElement.play();
}

// Find the specific link by its ID
const linkElement = document.getElementById('ameno');

// Attach a click event listener to the link
linkElement.addEventListener('click', playSong);
